import React from "react";
import { Row, Col, Button } from "antd";
import "./style.css";
import { UserOutlined } from "@ant-design/icons";
import Input from "../../components/input";
import OutlinedButtons from "../../components/button";

function SignUp() {
  const fullName = (e) => {
    const val = e.target.value;
    console.log(val);
  };
  const email = (e) => {
    const val = e.target.value;
    console.log(val);
  };
  const pass = (e) => {
    const val = e.target.value;
    console.log(val);
  };
  return (
    <Col className="bg">
      <Row
        style={{ marginTop: "10rem" }}
        display="flex"
        justify="center"
        align="middle"
      >
        <Col className="loginCard">
          <Col>
            <h1 style={{ fontFamily: "sans-serif", fontSize: "35px" }}>
              Sign Up
            </h1>
          </Col>
          <Col>
            <Input onChange={fullName} title="FullName" />
          </Col>
          <Col>
            <Input onChange={email} title="Email" />
          </Col>
          <Col>
            <Input onChange={pass} title="Password" />
          </Col>
          <Col>
            <OutlinedButtons text="Sign Up" />
          </Col>
        </Col>
      </Row>
    </Col>
  );
}

export default SignUp;
